waves.point_eqs_str:
////spiral code by Stahlregen

aturns = -5;
asize = 1;
aspeed =.1;

ax = (asize-asize*sample)*sin(aspeed*3.14*time+sample*6.28*aturns);
ay = (asize-asize*sample)*cos(aspeed*3.14*time+sample*6.28*aturns);

bturns = 5;
bsize = 1;
bspeed =-.3;

bx = (bsize-bsize*sample)*sin(bspeed*3.14*time+sample*6.28*bturns);
by = (bsize-bsize*sample)*cos(bspeed*3.14*time+sample*6.28*bturns);

x = - ax * bx + 0.5;
y = - ax * by + 0.5;

